import React from 'react';
import Banner  from './components/banner.jsx';
import Question  from './components/question.jsx';
//styles
import Container from 'react-bootstrap/Container'

function App() {
  return (
    <div className="App">
      <Container>
        <Row>
          <Col>1 of 1</Col>
        </Row>
     </Container>
      <Banner />
      <Question />
    </div>
  );
}

export default App;
